require.register("./client/editable-text-widget", Function("exports, module",
"// represents an editable attribute of a model\n\
// each of these gets its own reference to the model, which is fine\n\
// Backbone will handle all the concurrent updates\n\
\n\
var ItemView = require('./client/item-view');\n\
var _ = require('jashkenas~underscore@1.7.0');\n\
\n\
module.exports = ItemView.extend({\n\
  template: require('./client/editable-text-widget/editable-text-widget.html'),\n\
  tagName: 'span',\n\
  className: 'EditableText',\n\
  events: {\n\
    'click .toggle-edit': 'edit'\n\
  },\n\
\n\
  initialize: function(attr) {\n\
    this.attribute = attr.attribute || this.attribute;\n\
    this.maxWidth = attr.maxWidth;\n\
    this.href = attr.href || this.href;\n\
\n\
    _.bindAll(this, 'edit');\n\
    // keep track of whether the field is currently being edited or not\n\
    this.editing = false;\n\
  },\n\
\n\
  // toggle editing of the field\n\
  edit: function(e) {\n\
    this.$('.input').toggleClass('hidden');\n\
\n\
    this.$('.glyphicon').toggleClass('glyphicon-pencil').toggleClass('glyphicon-ok');\n\
\n\
    if (this.editing) {\n\
      // save\n\
      var attr = {};\n\
      attr[this.attribute] = this.$('input').val();\n\
      this.model.set(attr);\n\
\n\
      var instance = this;\n\
      this.model.save().done(function() {\n\
        instance.render();\n\
      });\n\
\n\
      this.$('.label').text(Messages('app.save'));\n\
    } else {\n\
      this.$('.label').text(Messages('app.edit'));\n\
      this.$('input').focus();\n\
    }\n\
\n\
    this.editing = !this.editing;\n\
  },\n\
\n\
  // we override serializeData because we need to get the text of a particular field, and the\n\
  // view doesn't know which field that is\n\
  serializeData: function() {\n\
    var href;\n\
\n\
    if (typeof this.href == \"function\")\n\
      href = this.href();\n\
\n\
    else if (_.isUndefined(this.href))\n\
      href = '#';\n\
\n\
    else\n\
      href = this.href;\n\
\n\
    var text = this.model.get(this.attribute);\n\
\n\
    if (!_.isUndefined(this.maxWidth) && !_.isNull(this.maxWidth) && !_.isNull(text) && text.length >= this.maxWidth) {\n\
      text = text.slice(0, this.maxWidth - 1);\n\
      text += '';\n\
    }\n\
\n\
    var value = this.model.isNew() ? '' : this.model.get(this.attribute);\n\
\n\
    return {\n\
      displayText: text,\n\
      value: value,\n\
      placeholder: text,\n\
      href: href\n\
    };\n\
  }\n\
});\n\
\n\
//# sourceURL=client/editable-text-widget/editable-text-widget.js"
));

