require.register("./client/deployment-progress-view", Function("exports, module",
"var BB = require('./client/bb');\n\
var ItemView = require('./client/item-view');\n\
var _ = require('jashkenas~underscore@1.7.0');\n\
\n\
module.exports = ItemView.extend({\n\
  template: require('./client/deployment-progress-view/deployment-progress-view.html'),\n\
\n\
  initialize: function(attr) {\n\
    this.model = new BB.Model({\n\
      name: attr.deployment.get('name'),\n\
      target: attr.target\n\
    });\n\
\n\
    this.deployment = attr.deployment;\n\
\n\
    _.bindAll(this, 'poll');\n\
  },\n\
\n\
  /**\n\
   * receive the current status of the deployment, and update dialog accordingly.\n\
   */\n\
  poll: function(data) {\n\
    if (data.completed) {\n\
      this.$('.progress-bar').removeClass('active').removeClass('progress-bar-striped');\n\
      // no need to keep polling\n\
      clearInterval(this.interval);\n\
\n\
      if (!data.error) {\n\
        // yay, it finished successfully!\n\
        this.setMessage('app.deployment.success');\n\
        this.setBarPosition(100);\n\
        this.$('.progress-bar').addClass('progress-bar-success');\n\
\n\
        // set up the link to view it\n\
        var href = data.baseUrl;\n\
\n\
        if (href) {\n\
          if (href.slice(-1) != '/')\n\
            href += '/';\n\
\n\
          // calculate the centroid latitude and longitude\n\
          var bounds = this.deployment.get('bounds');\n\
          var lat = (bounds.north + bounds.south) / 2;\n\
          var lon = (bounds.east + bounds.west) / 2;\n\
\n\
          // figure out the zoom. assume that otp.js will open in a window of the same size (e.g. a new tab)\n\
          var width = $(window).width();\n\
          var height = $(window).height();\n\
\n\
          // what fraction of the world is this from north to south?\n\
          // note that we are storing the denominator only, to avoid roundoff errors\n\
          var boundsHeightMerc = 180 / (bounds.north - bounds.south);\n\
\n\
          // longitude is generally more complicated, because the length depends on the latitude\n\
          // however, because we're using a Mercator projection, the map doesn't understand this either,\n\
          // and maps 360 degrees of longitude to an invariant width\n\
          // This is why Greenland appears larger than Africa, but it does make the math easy.\n\
          var boundsWidthMerc = 360 / (bounds.east - bounds.west);\n\
\n\
          // figure out the zoom level\n\
          // level 0 is the entireer world in a single 256x256 tile, next level\n\
          // is entire world in 256 * 2^1, then 256 * 2^2, and so on\n\
          var z = 23;\n\
\n\
          while (true) {\n\
            var worldSize = 256 * Math.pow(2, z);\n\
            // again, store the denominator/reciprocal\n\
            var windowWidthMerc = worldSize / width;\n\
            var windowHeightMerc = worldSize / height;\n\
\n\
            // if it fits. We use < not > because we have stored the reciprocals.\n\
            if (windowWidthMerc < boundsWidthMerc && windowHeightMerc < boundsHeightMerc || z === 0)\n\
              break;\n\
\n\
            z--;\n\
          }\n\
\n\
          var routerId = this.deployment.get('routerId');\n\
          href += '#start/' + lat + '/' + lon + '/' + z + '/' +\n\
            (!_.isUndefined(routerId) && routerId !== null ? routerId : 'default');\n\
\n\
          this.$('#result-link').attr('href', href)\n\
            .removeClass('hidden');\n\
        }\n\
      } else {\n\
        // uh-oh\n\
        this.setMessage(data.message || 'app.deployment.error');\n\
        this.$('.progress-bar').addClass('progress-bar-danger');\n\
      }\n\
    } else {\n\
      // deployment in progress\n\
      if (!data.built) {\n\
        // the server is building the data bundle\n\
        this.setMessage('app.deployment.building_bundle');\n\
      } else {\n\
        // are we uploading to S3, OTP, or waiting for the server to build a graph?\n\
        if (data.uploadingS3) {\n\
          this.setMessage('app.deployment.uploading_s3');\n\
          this.setBarPosition(data.percentUploaded);\n\
        } else if (data.uploading)\n\
          this.setMessage('app.deployment.uploading', data.numServersCompleted + 1, data.totalServers);\n\
        else\n\
          this.setMessage('app.deployment.building_graph', data.numServersCompleted + 1, data.totalServers);\n\
\n\
        // figure out progress bar position\n\
        var barPosition = 10; // we give 10% for building the bundle, which is done now\n\
\n\
        // figure out how many percent each server is worth\n\
        var serverPct = 90 / data.totalServers;\n\
\n\
        // add the amounts for each server that has completed so far\n\
        barPosition += serverPct * data.numServersCompleted;\n\
\n\
        // if we've finished uploading and are waiting for graph build on this server, give it another half\n\
        if (!data.uploading)\n\
          barPosition += serverPct / 2;\n\
\n\
        this.setBarPosition(barPosition);\n\
      }\n\
    }\n\
  },\n\
\n\
  /**\n\
   * Convenience function to set progress bar position\n\
   */\n\
  setBarPosition: function(percent) {\n\
    this.$('.progress-bar')\n\
      .css('width', percent + '%')\n\
      .attr('aria-valuenow', percent);\n\
  },\n\
\n\
  /**\n\
   * Convenience function to set status readout\n\
   */\n\
  setMessage: function() {\n\
    $('#progress-message').text(window.Messages.apply(window, arguments));\n\
  },\n\
\n\
  onShow: function() {\n\
    this.$('.modal').modal();\n\
\n\
    var instance = this;\n\
    this.interval = setInterval(function() {\n\
      $.ajax({\n\
        url: 'api/deployments/status/' + encodeURIComponent(instance.model.get('target')),\n\
        success: instance.poll\n\
      });\n\
    }, 1000);\n\
  },\n\
\n\
  onBeforeDestroy: function() {\n\
    clearInterval(this.interval);\n\
  }\n\
});\n\
\n\
//# sourceURL=client/deployment-progress-view/deployment-progress-view.js"
));

