require.register("./client/feed-version-navigation-view", Function("exports, module",
"var _ = require('jashkenas~underscore@1.7.0');\n\
var FeedVersion = require('./client/feed-version');\n\
var FeedUploadView = require('./client/feed-upload-view');\n\
var FeedSource = require('./client/feed-source');\n\
var app = require('./client/application');\n\
var LayoutView = require('./client/layout-view');\n\
\n\
module.exports = LayoutView.extend({\n\
  template: require('./client/feed-version-navigation-view/feed-version-navigation-view.html'),\n\
\n\
  events: {\n\
    'click .upload-feed': 'uploadFeed',\n\
    'click .update-feed': 'updateFeed'\n\
  },\n\
\n\
  // show the feed upload dialog\n\
  uploadFeed: function(e) {\n\
    // model is so that it knows what feed source to upload to\n\
    app.modalRegion.show(new FeedUploadView({\n\
      model: new FeedSource(this.model.get('feedSource'))\n\
    }));\n\
  },\n\
\n\
  // fetch the latest version of an autofetched/produced in house feed\n\
  updateFeed: function(e) {\n\
    // user feedback\n\
    var $t = $(e.target);\n\
    $t.find('span.glyphicon').addClass('spinner');\n\
    $t.attr('disabled', true);\n\
    $t.find('span.button-label').text(window.Messages('app.feed_version.updating'));\n\
\n\
    var instance = this;\n\
    $.ajax({\n\
      url: 'api/feedsources/' + this.model.get('feedSource').id + '/fetch',\n\
      method: 'POST',\n\
      success: function(data) {\n\
        $t.find('span').removeClass('spinner');\n\
        $t.attr('disabled', false);\n\
        $t.find('span.button-label').text(window.Messages('app.feed_version.update'));\n\
\n\
        if (data === null) {\n\
          window.alert('Feed has not changed');\n\
        } else {\n\
          var newVersion = new FeedVersion(data);\n\
          window.location.hash = '#feed/' + newVersion.get('feedSource').id + '/' + newVersion.id;\n\
        }\n\
      }\n\
    });\n\
  },\n\
\n\
  initialize: function(attr) {\n\
    if (_.isUndefined(this.model)) {\n\
      // we create a dummy model simply so we don't have to check in the view if the model exists, only if its properties exist\n\
      // and so we can access the feedSource in a uniform way regardless of whether the version exists\n\
      this.model = new FeedVersion({\n\
        feedSource: attr.feedSource.toJSON()\n\
      });\n\
    }\n\
\n\
    _.bindAll(this, 'uploadFeed', 'updateFeed');\n\
  },\n\
})\n\
\n\
//# sourceURL=client/feed-version-navigation-view/feed-version-navigation-view.js"
));

