require.register("./client/feed-source-view", Function("exports, module",
"/**\n\
 * Show some information about a feed source\n\
 */\n\
\n\
var _ = require('jashkenas~underscore@1.7.0');\n\
var app = require('./client/application');\n\
var FeedVersion = require('./client/feed-version');\n\
var FeedVersionView = require('./client/feed-version-view');\n\
var NoteCollectionView = require('./client/note-collection-view');\n\
var FeedVersionNavigationView = require('./client/feed-version-navigation-view');\n\
var LayoutView = require('./client/layout-view');\n\
\n\
module.exports = LayoutView.extend({\n\
  template: require(\"./client/feed-source-view/feed-source-view.html\"),\n\
  regions: {\n\
    validationRegion: '#validation',\n\
    notesRegion: '.source-notes',\n\
    versionNavigationRegion: '#version-navigation'\n\
  },\n\
\n\
  events: {\n\
    'click #share-url': 'doNothing',\n\
    'click .deploy': 'deploy'\n\
  },\n\
\n\
  initialize: function(attr) {\n\
    this.feedVersionId = attr.feedVersionId;\n\
  },\n\
\n\
  onShow: function() {\n\
    var instance, version;\n\
\n\
    if (this.feedVersionId)\n\
      version = new FeedVersion({\n\
        id: this.feedVersionId\n\
      });\n\
\n\
    else\n\
      version = new FeedVersion({\n\
        id: this.model.get('latestVersionId')\n\
      });\n\
\n\
    var navBase = [{\n\
      name: this.model.get('feedCollection').name,\n\
      href: '#overview/' + this.model.get('feedCollection').id\n\
    }, {\n\
      name: this.model.get('name'),\n\
      href: '#feed/' + this.model.id\n\
    }];\n\
\n\
    if (version.get('id') !== null) {\n\
\n\
      instance = this;\n\
      version.fetch().done(function() {\n\
        instance.validationRegion.show(new FeedVersionView({\n\
          model: version\n\
        }));\n\
        instance.versionNavigationRegion.show(new FeedVersionNavigationView({\n\
          model: version\n\
        }));\n\
\n\
        // set up nav\n\
        navBase.push({\n\
          name: window.Messages('app.feed_version.version_number', version.get('version')),\n\
          href: '#feed/' + instance.model.id + '/' + version.id\n\
        });\n\
\n\
        app.nav.setLocation(navBase);\n\
      });\n\
    } else {\n\
      this.versionNavigationRegion.show(new FeedVersionNavigationView({\n\
        feedSource: this.model\n\
      }));\n\
\n\
      // no version to speak of\n\
      app.nav.setLocation(navBase);\n\
    }\n\
\n\
    // expose the copypastable URL to allow users to view/edit\n\
    if (app.user.admin) {\n\
      instance = this;\n\
      $.ajax({\n\
        url: 'api/feedsources/' + this.model.get('id') + '/getKey',\n\
        success: function(data) {\n\
          instance.$('#share-url').val(window.location.origin + window.location.pathname + window.location.hash +\n\
            '?userId=' + encodeURIComponent(data.userId) +\n\
            '&key=' + encodeURIComponent(data.key));\n\
        }\n\
      });\n\
    }\n\
\n\
    // set up comments\n\
    this.notesRegion.show(new NoteCollectionView({\n\
      objectId: this.model.get('id'),\n\
      type: 'FEED_SOURCE'\n\
    }));\n\
  },\n\
\n\
  // don't bubble clicks in the input field (e.g. to copy)\n\
  doNothing: function(e) {\n\
    e.preventDefault();\n\
    e.stopPropagation();\n\
  },\n\
\n\
  deploy: function(e) {\n\
    $.ajax({\n\
      url: 'api/deployments/fromfeedsource/' + this.model.id,\n\
      method: 'post',\n\
      success: function(data) {\n\
        window.location.hash = '#deployment/' + data.id;\n\
      }\n\
    });\n\
  }\n\
\n\
})\n\
\n\
//# sourceURL=client/feed-source-view/feed-source-view.js"
));

