require.register("./client/autologin-route", Function("exports, module",
"/**\n\
 * Automatically log in a user with a userId and key, so they can view/upload to a feedsource.\n\
 */\n\
\n\
var app = require('./client/application');\n\
\n\
module.exports = function() {\n\
  var feedSourceId, feedVersionId, userId, key;\n\
\n\
  // yes, this is in fact four arguments, not five, but the Bootstrap router throws an extra null on the end\n\
  if (arguments.length == 5) {\n\
    feedSourceId = arguments[0];\n\
    feedVersionId = arguments[1];\n\
    userId = arguments[2];\n\
    key = arguments[3];\n\
  } else if (arguments.length == 4) {\n\
    feedSourceId = arguments[0];\n\
    feedVersionId = null;\n\
    userId = arguments[1];\n\
    key = arguments[2];\n\
  } else return;\n\
\n\
  $.post('/authenticate', {\n\
      userId: userId,\n\
      key: key\n\
    })\n\
    .then(function(data) {\n\
      $('#logged-in-user').text(window.Messages('app.account.logged_in_as', data['username']));\n\
      $('#logout').removeClass('hidden');\n\
\n\
      // note: log out is handled in application.js\n\
\n\
      app.user = data;\n\
\n\
      window.location.hash = '#feed/' + feedSourceId +\n\
        (feedVersionId != null ? '/' + feedVersionId : '');\n\
    })\n\
    .fail(function() {\n\
      // TODO: alert is bad, bad error message, not translatable.\n\
      alert('Invalid key');\n\
    });\n\
}\n\
\n\
//# sourceURL=client/autologin-route/autologin-route.js"
));

