require.register("./client/otp-config-view", Function("exports, module",
"var ItemView = require('./client/item-view');\n\
var _ = require('jashkenas~underscore@1.7.0');\n\
\n\
module.exports = ItemView.extend({\n\
  className: 'row',\n\
  tagName: 'form',\n\
  template: require('./client/otp-config-view/template.html'),\n\
\n\
  events: {\n\
    'click .add-updater': 'addUpdater',\n\
    'click .remove-updater': 'removeUpdater',\n\
    'submit': 'save'\n\
  },\n\
\n\
  initialize: function() {\n\
    var self = this;\n\
    this.listenTo(this.model, 'change:routerConfig', function() {\n\
      self.render();\n\
    });\n\
  },\n\
\n\
  serializeData: function() {\n\
    var buildConfig = this.model.get('buildConfig');\n\
    var routerConfig = this.model.get('routerConfig');\n\
\n\
    return {\n\
      build: dataToInputs(buildConfig),\n\
      router: dataToInputs(_.omit(routerConfig, 'updaters')),\n\
      updaters: (routerConfig ? (routerConfig.updaters || []) : []).map(dataToInputs)\n\
    };\n\
\n\
    /*var conf = this.model.get('otpConfig');\n\
\n\
    return {\n\
      build: dataToInputs(conf.build),\n\
      router: dataToInputs(conf.router),\n\
      updaters: (conf.updaters || []).map(dataToInputs)\n\
    };*/\n\
  },\n\
\n\
  addUpdater: function(e) {\n\
    e.preventDefault();\n\
    var data = this.serializeForm();\n\
    data.routerConfig.updaters.push({\n\
      type: null,\n\
      sourceType: null,\n\
      url: null,\n\
      frequency: null,\n\
      defaultAgencyId: null\n\
    });\n\
    this.model.set('routerConfig', data.routerConfig);\n\
  },\n\
\n\
  removeUpdater: function(e) {\n\
    e.preventDefault();\n\
    this.$(e.target).closest('fieldset[data-section=updater]').remove()\n\
    this.model.set('otpConfig', this.serializeForm());\n\
  },\n\
\n\
  serializeForm: function() {\n\
    var routerConfig = inputsToData(this.$('fieldset[data-section=router]'));\n\
    routerConfig.updaters = this.$('fieldset[data-section=updater]').get().map(inputsToData);\n\
    return {\n\
      buildConfig: inputsToData(this.$('fieldset[data-section=build]')),\n\
      routerConfig: routerConfig\n\
    };\n\
  },\n\
\n\
  save: function(e) {\n\
    e.preventDefault();\n\
    this.model.save(this.serializeForm());\n\
  }\n\
});\n\
\n\
function dataToInputs(data) {\n\
  if (!data) return [];\n\
  var inputs = [];\n\
  for (var key in data) {\n\
    inputs.push({\n\
      name: key,\n\
      value: data[key],\n\
      type: 'text',\n\
      placeholder: key\n\
    });\n\
  }\n\
  return inputs;\n\
}\n\
\n\
function inputsToData(el) {\n\
  var data = {};\n\
  $(el).find('input').each(function() {\n\
    data[$(this).attr('name')] = parse($(this).val());\n\
  });\n\
  return data;\n\
}\n\
\n\
function parse(v) {\n\
  try {\n\
    var f = parseFloat(v);\n\
    if (!f.isNaN() && (f + '').length === v.length) return f;\n\
  } catch(e) {}\n\
\n\
  try {\n\
    var i = parseInt(v);\n\
    if (!i.isNaN() && ((i + '').length === v.length || (i + '.0').length === v.length)) return i;\n\
  } catch(e) {}\n\
\n\
  if (v === 'true' || v === 'false') return v === 'true';\n\
\n\
  if (v === '') return null;\n\
\n\
  return v;\n\
}\n\
\n\
//# sourceURL=client/otp-config-view/index.js"
));

